import React, { useEffect, useState } from 'react';
import { Client } from '@stomp/stompjs';
import SockJS from 'sockjs-client';
import '../CSS/sonar.css';

const WebSocketComponent = () => {
    const [data, setData] = useState(null);

    useEffect(() => {
        // const socket = new SockJS('https://severity-server-7fa3d2ffa383.herokuapp.com/ws');
        const socket = new SockJS('http://localhost:8080/ws');
        const stompClient = new Client({
            webSocketFactory: () => socket,
            onConnect: () => {
                console.log('Connected');
                stompClient.subscribe('/sonarmetrics/recieved', (message) => {
                    setData(JSON.parse(message.body));
                });
            },
            onDisconnect: () => {
                console.log('Disconnected');
            },
        });

        stompClient.activate();

        return () => {
            stompClient.deactivate();
        };
    }, []);

    return (
        <div className='main'>
            <h1>SonarQube Metrics</h1>
        </div>
    );
};

export default WebSocketComponent;
